import React from "react";
import ReactDOM from "react-dom/client";
import "./App.scss";
import App from "./App";
import { Provider } from "./context/MovieContext";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <Provider>
    <App />
  </Provider>
);
